export function getErrorMessage(error){
    if (error.response && error.response.data && error.response.data.statusMessage) {
        return error.response.data.statusMessage;
    }
    return '오류가 발생했습니다.';
}

export function getResultData(response){
    return response.data.result;  // 올바른 경로
}
